            <Checkbox
              sx={{
                color: '#7D4896',
                '&.Mui-checked': {
                  color: '#7D4896',
                },
              }}
            checked={selectedDays.includes('Saturday')}
            onChange={() => handleCheckboxChange('Saturday')}
          />
                <Typography sx={{ color: '#707070', fontSize: '15px',marginLeft:'-30px' }}>
                Saturday
                </Typography>
                <Divider sx={{ width: '100px', height: '1px', marginTop: '10px', backgroundColor: '#018EA2' }} />
                {selectedDays.includes('Saturday') && (
            <>
              <Typography sx={{ color: '#707070', fontSize: '15px' }}>
                From
              </Typography>
              <TextField
                defaultValue="12:00"
                type='time'
                sx={{
                  width: '200px',
                  '.MuiInputBase-root': { color: "#7D4896", height: '40px', border: '1.2px solid #018EA2' }
                }}
                onChange={(event) => handleTimeChange(event, 'Saturday')}
                name="from"
              />
              <Typography sx={{ color: '#707070', fontSize: '15px' }}>
                To
              </Typography>
              <TextField
                defaultValue="12:00"
                type='time'
                sx={{
                  width: '200px',
                  '.MuiInputBase-root': { color: "#7D4896", height: '40px', border: '1.2px solid #018EA2' }
                }}
                onChange={(event) => handleTimeChange(event, 'Saturday')}
                name="to"
              />
            </>
          )}
            </Stack>

            <Stack direction='row' gap={6} sx={{display:'flex',flexWrap:'wrap',justifyContent:'center',alignItems:'center'}}>
