                <Divider sx={{width:'100px',height:'1px',marginTop:'10px' , backgroundColor:'#018EA2'}}/>
                {selectedDays.includes('Sunday') && (
            <>
              <Typography sx={{ color: '#707070', fontSize: '15px' }}>
                From
              </Typography>
              <TextField
                defaultValue="12:00"
                type='time'
                sx={{
                  width: '200px',
                  '.MuiInputBase-root': { color: "#7D4896", height: '40px', border: '1.2px solid #018EA2' }
                }}
                onChange={(event) => handleTimeChange(event, 'Sunday')}
                name="from"
              />
              <Typography sx={{ color: '#707070', fontSize: '15px' }}>
                To
              </Typography>
              <TextField
                defaultValue="12:00"
                type='time'
                sx={{
                  width: '200px',
                  '.MuiInputBase-root': { color: "#7D4896", height: '40px', border: '1.2px solid #018EA2' }
