                  color: '#7D4896',
                },
              }}
            checked={selectedDays.includes('Wednesday')}
            onChange={() => handleCheckboxChange('Wednesday')}
          />
                <Typography sx={{color:'#707070',fontSize:'15px'}}>
                Wednesday
                </Typography>
                <Divider sx={{width:'100px',height:'1px',marginTop:'10px' , backgroundColor:'#018EA2'}}/>
                {selectedDays.includes('Wednesday') && (
            <>
              <Typography sx={{ color: '#707070', fontSize: '15px' }}>
                From
              </Typography>
              <TextField
                defaultValue="12:00"
                type='time'
                sx={{
                  width: '200px',
                  '.MuiInputBase-root': { color: "#7D4896", height: '40px', border: '1.2px solid #018EA2' }
                }}
                onChange={(event) => handleTimeChange(event, 'Wednesday')}
                name="from"
              />
              <Typography sx={{ color: '#707070', fontSize: '15px' }}>
                To
              </Typography>
              <TextField
                defaultValue="12:00"
                type='time'
                sx={{
                  width: '200px',
                  '.MuiInputBase-root': { color: "#7D4896", height: '40px', border: '1.2px solid #018EA2' }
                }}
                onChange={(event) => handleTimeChange(event, 'Wednesday')}
                name="to"
              />
            </>
          )}
            </Stack>

            <Stack direction='row' gap={6} sx={{display:'flex',flexWrap:'wrap',justifyContent:'center',alignItems:'center'}}>
            <Checkbox
              sx={{
                color: '#7D4896',
                '&.Mui-checked': {
                  color: '#7D4896',
                },
              }}
            checked={selectedDays.includes('Thursday')}
            onChange={() => handleCheckboxChange('Thursday')}
          />
                <Typography sx={{color:'#707070',fontSize:'15px'}}>
                Thursday
                </Typography>
                <Divider sx={{width:'100px',height:'1px',marginTop:'10px' , backgroundColor:'#018EA2'}}/>
                {selectedDays.includes('Thursday') && (
            <>
              <Typography sx={{ color: '#707070', fontSize: '15px' }}>
                From
              </Typography>
              <TextField
                defaultValue="12:00"
                type='time'
